import React, { useState, useEffect } from 'react';
import { Grid, Box, Typography, Fade, Grow, Button, Paper } from '@mui/material';
import HealthOverview from '../components/HealthOverview';
import DoctorSelection from '../components/DoctorSelection';
import SleepTracking from '../components/SleepTracking';
import RecoveryGoal from '../components/RecoveryGoal';
import api from '../services/api';
import { formatEther } from 'ethers';
import AccountBalanceWalletIcon from '@mui/icons-material/AccountBalanceWallet';

const HomeScreen = ({ account, provider }) => {
  const [healthTips, setHealthTips] = useState([]);
  const [currentTipIndex, setCurrentTipIndex] = useState(0);
  const [balance, setBalance] = useState(null);

  useEffect(() => {
    const fetchHealthTips = async () => {
      const response = await api.getHealthTips();
      setHealthTips(response.data);
    };
    fetchHealthTips();
  }, []);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentTipIndex((prevIndex) => (prevIndex + 1) % healthTips.length);
    }, 5000);
    return () => clearInterval(interval);
  }, [healthTips]);

  const getBalance = async () => {
    if (provider && account) {
      const balance = await provider.getBalance(account);
      setBalance(formatEther(balance));
    }
  };

  return (
    <Box sx={{ flexGrow: 1, p: 3, overflow: 'hidden' }}>
      <Fade in={true} timeout={1000}>
        <Typography variant="h4" gutterBottom sx={{ 
          mb: 4, 
          textAlign: 'center', 
          color: '#FFFFFF',
          textShadow: '2px 2px 4px rgba(0,0,0,0.5)',
          fontWeight: 'bold'
        }}>
          Welcome to Your Health Dashboard
        </Typography>
      </Fade>

      {healthTips.length > 0 && (
        <Fade in={true} timeout={1000}>
          <Box sx={{ mb: 4, textAlign: 'center', height: '50px' }}>
            <Typography variant="h6" sx={{ color: '#FFFFFF', textShadow: '1px 1px 2px rgba(0,0,0,0.5)' }}>
              Tip of the Day:
            </Typography>
            <Typography sx={{ color: '#FFFFFF', textShadow: '1px 1px 2px rgba(0,0,0,0.5)' }}>
              {healthTips[currentTipIndex]}
            </Typography>
          </Box>
        </Fade>
      )}

      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <Grow in={true} timeout={1000}>
            <Paper elevation={3} sx={{ p: 3, height: '100%', backgroundColor: 'rgba(255, 255, 255, 0.9)' }}>
              <Typography variant="h5" gutterBottom>Ethereum Wallet</Typography>
              {account ? (
                <>
                  <Typography variant="body1" sx={{ mb: 2 }}>
                    Connected Account: {`${account.slice(0, 6)}...${account.slice(-4)}`}
                  </Typography>
                  <Button variant="contained" onClick={getBalance} startIcon={<AccountBalanceWalletIcon />}>
                    Check ETH Balance
                  </Button>
                  {balance && (
                    <Typography variant="h6" sx={{ mt: 2 }}>
                      Balance: {parseFloat(balance).toFixed(4)} ETH
                    </Typography>
                  )}
                </>
              ) : (
                <Typography variant="body1">
                  Please connect your Ethereum wallet to access Web3 features.
                </Typography>
              )}
            </Paper>
          </Grow>
        </Grid>
        <Grid item xs={12} md={6}>
          <Grow in={true} timeout={1500}>
            <Box>
              <HealthOverview />
            </Box>
          </Grow>
        </Grid>
        <Grid item xs={12} md={6}>
          <Grow in={true} timeout={2000}>
            <Box>
              <DoctorSelection />
            </Box>
          </Grow>
        </Grid>
        <Grid item xs={12} md={3}>
          <Grow in={true} timeout={2500}>
            <Box>
              <SleepTracking />
            </Box>
          </Grow>
        </Grid>
        <Grid item xs={12} md={3}>
          <Grow in={true} timeout={3000}>
            <Box>
              <RecoveryGoal />
            </Box>
          </Grow>
        </Grid>
      </Grid>
    </Box>
  );
};

export default HomeScreen;
